        {\"total_count\":494,\"incomplete_results\":false,\"items\":[{\"url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/494\",\"repository_url\":\"https://api.github.com/repos/mac-cain13/R.swift\",\"labels_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/494/labels{/name}\",\"comments_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/494/comments\",\"events_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/494/events\",\"html_url\":\"https://github.com/mac-cain13/R.swift/issues/494\",\"id\":416196322,\"node_id\":\"MDU6SXNzdWU0MTYxOTYzMjI=\",\"number\":494,\"title\":\"Nib files generation doesn't support multiple nested reuse identifiers\",\"user\":{\"login\":\"avangel\",\"id\":4037567,\"node_id\":\"MDQ6VXNlcjQwMzc1Njc=\",\"avatar_url\":\"https://avatars3.githubusercontent.com/u/4037567?v=4\",\"gravatar_id\":\"\",\"url\":\"https://api.github.com/users/avangel\",\"html_url\":\"https://github.com/avangel\",\"followers_url\":\"https://api.github.com/users/avangel/followers\",\"following_url\":\"https://api.github.com/users/avangel/following{/other_user}\",\"gists_url\":\"https://api.github.com/users/avangel/gists{/gist_id}\",\"starred_url\":\"https://api.github.com/users/avangel/starred{/owner}{/repo}\",\"subscriptions_url\":\"https://api.github.com/users/avangel/subscriptions\",\"organizations_url\":\"https://api.github.com/users/avangel/orgs\",\"repos_url\":\"https://api.github.com/users/avangel/repos\",\"events_url\":\"https://api.github.com/users/avangel/events{/privacy}\",\"received_events_url\":\"https://api.github.com/users/avangel/received_events\",\"type\":\"User\",\"site_admin\":false},\"labels\":[],\"state\":\"open\",\"locked\":false,\"assignee\":null,\"assignees\":[],\"milestone\":null,\"comments\":0,\"created_at\":\"2019-03-01T17:06:50Z\",\"updated_at\":\"2019-03-01T17:30:32Z\",\"closed_at\":null,\"author_association\":\"NONE\",\"body\":\"I have a Nib file containing a single TableViewCell with a reuse identifier. Inside this cell, I also have a nested UICollectionView also containing cells with reuse identifiers.\\r\\n\\r\\nAfter some investigation, I found the issue https://github.com/mac-cain13/R.swift/issues/223 talking about a test preventing more than one reuse identifier in `NibGenerator.swift`. This test prevents the generation of any reuse identifier, thus my table view cell nib cannot be registered in table view because it no longer implements the proper protocol.\\r\\n\\r\\nI removed this check and the reuse identifier of the top table view cell is correctly generated.\\r\\n\\r\\nI also discovered than Nib files do not automatically register cells reuse identifiers as it is the case with storyboards. So maybe we could simply generate the top view reuse identifier and skip the remaining ones.\",\"score\":1},{\"url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/491\",\"repository_url\":\"https://api.github.com/repos/mac-cain13/R.swift\",\"labels_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/491/labels{/name}\",\"comments_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/491/comments\",\"events_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/491/events\",\"html_url\":\"https://github.com/mac-cain13/R.swift/issues/491\",\"id\":415043655,\"node_id\":\"MDU6SXNzdWU0MTUwNDM2NTU=\",\"number\":491,\"title\":\"Ignore fetching .strings files\",\"user\":{\"login\":\"HadiYaac\",\"id\":20638321,\"node_id\":\"MDQ6VXNlcjIwNjM4MzIx\",\"avatar_url\":\"https://avatars2.githubusercontent.com/u/20638321?v=4\",\"gravatar_id\":\"\",\"url\":\"https://api.github.com/users/HadiYaac\",\"html_url\":\"https://github.com/HadiYaac\",\"followers_url\":\"https://api.github.com/users/HadiYaac/followers\",\"following_url\":\"https://api.github.com/users/HadiYaac/following{/other_user}\",\"gists_url\":\"https://api.github.com/users/HadiYaac/gists{/gist_id}\",\"starred_url\":\"https://api.github.com/users/HadiYaac/starred{/owner}{/repo}\",\"subscriptions_url\":\"https://api.github.com/users/HadiYaac/subscriptions\",\"organizations_url\":\"https://api.github.com/users/HadiYaac/orgs\",\"repos_url\":\"https://api.github.com/users/HadiYaac/repos\",\"events_url\":\"https://api.github.com/users/HadiYaac/events{/privacy}\",\"received_events_url\":\"https://api.github.com/users/HadiYaac/received_events\",\"type\":\"User\",\"site_admin\":false},\"labels\":[],\"state\":\"open\",\"locked\":false,\"assignee\":null,\"assignees\":[],\"milestone\":null,\"comments\":1,\"created_at\":\"2019-02-27T10:10:38Z\",\"updated_at\":\"2019-02-28T09:03:44Z\",\"closed_at\":null,\"author_association\":\"NONE\",\"body\":\"Hello,\\r\\n\\r\\nThanks for this great repository that I used in 25+ apps!\\r\\n\\r\\nI was just wondering how to fix the below:\\r\\n\\r\\nIn my Localizable.strings file, I tend to name my keys like the values so for example:\\r\\n`anyLabel.text = \\\"Thanks for R.swift\\\".localized`\\r\\n\\r\\nin my Localizable.strings (en) file:\\r\\n`\\\"Thanks for R.swift\\\" = \\\"Thanks for R.swift\\\";`\\r\\n\\r\\nThis creates a problem with R.swift:\\r\\n\\r\\n> invalid redeclaration of 'Thanks for R.swift'\\r\\n\\r\\n\\r\\n![error screenshot](https://user-images.githubusercontent.com/20638321/53482615-4ccd5880-3a88-11e9-8bfd-2cedce9350d6.png)\\r\\n\\r\\n> And below is a part of my  Localizable.strings (en) file:\\r\\n![localizable strings screenshot](https://user-images.githubusercontent.com/20638321/53482758-a6358780-3a88-11e9-8105-5a6fb45178ff.png)\\r\\n\\r\\nPlus note that I tried including my Localizable.strings files in the .rswiftignore but that didn't work and I guess it is because the usage of the **StringResource**\",\"score\":1},{\"url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/484\",\"repository_url\":\"https://api.github.com/repos/mac-cain13/R.swift\",\"labels_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/484/labels{/name}\",\"comments_url\":\"https://api.github.com/re