"COLLABORATOR\",\"body\":\"Check if fonts used in Nibs/Storyboards are actually in the project. Like we already do for images.\",\"score\":1},{\"url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/487\",\"repository_url\":\"https://api.github.com/repos/mac-cain13/R.swift\",\"labels_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/487/labels{/name}\",\"comments_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/487/comments\",\"events_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/487/events\",\"html_url\":\"https://github.com/mac-cain13/R.swift/issues/487\",\"id\":408091237,\"node_id\":\"MDU6SXNzdWU0MDgwOTEyMzc=\",\"number\":487,\"title\":\"R.generated.swift not compiling\",\"user\":{\"login\":\"Przemyslaw-Wosko\",\"id\":7043158,\"node_id\":\"MDQ6VXNlcjcwNDMxNTg=\",\"avatar_url\":\"https://avatars1.githubusercontent.com/u/7043158?v=4\",\"gravatar_id\":\"\",\"url\":\"https://api.github.com/users/Przemyslaw-Wosko\",\"html_url\":\"https://github.com/Przemyslaw-Wosko\",\"followers_url\":\"https://api.github.com/users/Przemyslaw-Wosko/followers\",\"following_url\":\"https://api.github.com/users/Przemyslaw-Wosko/following{/other_user}\",\"gists_url\":\"https://api.github.com/users/Przemyslaw-Wosko/gists{/gist_id}\",\"starred_url\":\"https://api.github.com/users/Przemyslaw-Wosko/starred{/owner}{/repo}\",\"subscriptions_url\":\"https://api.github.com/users/Przemyslaw-Wosko/subscriptions\",\"organizations_url\":\"https://api.github.com/users/Przemyslaw-Wosko/orgs\",\"repos_url\":\"https://api.github.com/users/Przemyslaw-Wosko/repos\",\"events_url\":\"https://api.github.com/users/Przemyslaw-Wosko/events{/privacy}\",\"received_events_url\":\"https://api.github.com/users/Przemyslaw-Wosko/received_events\",\"type\":\"User\",\"site_admin\":false},\"labels\":[],\"state\":\"closed\",\"locked\":false,\"assignee\":null,\"assignees\":[],\"milestone\":null,\"comments\":4,\"created_at\":\"2019-02-08T10:29:56Z\",\"updated_at\":\"2019-02-25T15:24:46Z\",\"closed_at\":\"2019-02-25T15:24:46Z\",\"author_association\":\"NONE\",\"body\":\"Xcode 10.1 (10B61)\\r\\nCarthage: \\r\\ngithub \\\"mac-cain13/R.swift.Library\\\" ~> 5.0.2\\r\\nSwift 4.2\\r\\n\\r\\nHi, \\r\\nI'm struggling with 2 issues in generated file: \\r\\n1) \\r\\n```\\r\\n/<path>/<project>/Resources/R.generated.swift:35:33: Module 'Rswift' has no member named 'ColorPaletteItemResource'\\r\\n```\\r\\ngenerated code\\r\\n```\\r\\nstruct palette {\\r\\n      /// <span style='background-color: #00000066; color: #FFFFFF; padding: 1px 3px;'>#00000066</span> tabButtonInactive\\r\\n      static let tabButtonInactive = Rswift.ColorPaletteItemResource(name: \\\"tabButtonInactive\\\", red: 0.0, green: 0.0, blue: 0.0, alpha: 0.4)\\r\\n```\\r\\n2) \\r\\n```\\r\\n/<path>/<project>/Resources/R.generated.swift:760:60: Cannot convert value of type '[NSObject : AnyObject]?' to expected argument type '[UINib.OptionsKey : Any]?'\\r\\n```\\r\\n\\r\\ngenerated code: \\r\\n```\\r\\nstruct _BuyAccessView: Rswift.NibResourceType {\\r\\n      let bundle = R.hostingBundle\\r\\n      let name = \\\"BuyAccessView\\\"\\r\\n      \\r\\n      func firstView(owner ownerOrNil: AnyObject?, options optionsOrNil: [NSObject : AnyObject]? = nil) -> BuyAccessView? {\\r\\n        return instantiate(withOwner: ownerOrNil, options: optionsOrNil)[0] as? BuyAccessView\\r\\n      }\\r\\n      \\r\\n      fileprivate init() {}\\r\\n    }\\r\\n```\\r\\n\\r\\n\",\"score\":1},{\"url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/490\",\"repository_url\":\"https://api.github.com/repos/mac-cain13/R.swift\",\"labels_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/490/labels{/name}\",\"comments_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/490/comments\",\"events_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/490/events\",\"html_url\":\"https://github.com/mac-cain13/R.swift/issues/490\",\"id\":412727259,\"node_id\":\"MDU6SXNzdWU0MTI3MjcyNTk=\",\"number\":490,\"title\":\"Recommend project structure of R.swift\",\"user\":{\"login\":\"wei2lee\",\"id\":4197940,\"node_id\":\"MDQ6VXNlcjQxOTc5NDA=\",\"avatar_url\":\"https://avatars0.githubusercontent.com/u/4197940?v=4\",\"gravatar_id\":\"\",\"url\":\"https://api.github.com/users/wei2lee\",\"html_url\":\"https://github.com/wei2lee\",\"followers_url\":\"https://api.github.com/users/wei2lee/followers\",\"following_url\":\"https://api.github.com/users/wei2lee/following{/other_user}\",\"gists_url\":\"https://api.github.com/users/wei2lee/gists{/gist_id}\",\"starred_url\":\"https://api.github.com/users/wei2lee/starred{/owner}{/repo}\",\"subscriptions_url\":\"https://api.github.com/users/wei2lee/subscriptions\",\"organizations_url\":\"https://api.github.com/users/wei2lee/orgs\",\"repos_url\":\"https://api.github.com/users/wei2lee/repos\",\"events_url\":\"https://api.github.com/users/wei2lee/events{/privacy}\",\"received_events_url\":\"https://api.github.com/users/wei2lee/received_events\",\"type\":\"User\",\"site_admin\":false},\"labels\":[],\"state\":\"open\",\"locked\":false,\"assignee\":null,\"assignees\":[],\"milestone\":null,\"comments\":3,\"created_at\":\"2019-02-21T03:06:32Z\",\"updated_at\":\"2019-02-25T08:19:48Z\",\"closed_at\":null,\"author_association\":\"NONE\",\"body\":\"I am a big fan of static resource mapping which gives a lot of compile-time checking, autocompleting feature of resource and I like your library very much!\\r\\n\\r\\nHowever, after my project deploy finish, I come back to revise why our project is compiling so slow there are 3 categories of suggestions on Web: \\r\\n1. Project Setting Tweak \\r\\n2. Modularization \\r\\n3. Source Code line by line tweak\\r\\nand all of them are measuring by BuildTimeAnalyzer/Build with Timing Summary.\\r\\n\\r\\nI find there are no any article describing viewing point of \\\"after I edited a .swift file, how many .swift will be recompile\\\". Currently my checking this by steps:\\r\\n\\r\\n1. Changing the line \\\"private var a = 2\\\" to \\\"private var a = 3\\\"\\r\\n\\r\\n2. Go to XCode -> Show the Report Navigator -> Compile Swift source files -> checking number of line \\\"Compile xxxx.swift\\\"\\r\\n\\r\\n\\r\\nscreenshot: https://imgur.com/a/9rMwTsV (Checking number of compile files)\\r\\nproject: https://drive.google.com/file/d/1Jh5V_sRZKiy7RO2CWAgxwpNRSuqnbyXe/view?usp=sharing\\r\\n\\r\\nThrough my trial and error, I found that: if any .swift contains any reference of R struct, and after I did any changes making the R.generated.swift rebuild, those .swift will rebuild. \\r\\n\\r\\nMy guessing is that: \\r\\n\\r\\nR structure is a dependency all ViewController.swift, and R struct has the interface of every ViewController through struct storyboard. \\r\\nChanging any of these ViewController.swift will make XCode think these ViewController interface change, \\r\\nthen XCode decides that R structure has an interface change due to R structure expose these ViewController as one of the storyboard struct.\\r\\nand last, all files that contain R struct will recompile because R has an interface change.\\r\\n\\r\\n\\r\\nI can improve the number of compiling file number by Modularization, spliting R struct into smaller R struct by Module-basic, and making them into a .Framework and link in Main Target.\\r\\n\\r\\nAssuming I want to archive both targets of \\r\\n1. less file compile = less build time \\r\\n2. all benefit of static resource mapping bring\\r\\n\\r\\nIs Modularization the only solution?\\r\\n\\r\\n\\r\\n\\r\\nBefore I decide to use R.swift library, actually I am very impressed by AndroidStudio auto-generating R structure after I saved any .xml file.\\r\\nI noticed that in AndroidStudio, Whenever I edited AAcitivy.java, Android Studio recompiling only AAcitivity.java. I don't understand how XCode decide to build more files if it is using swift langauge?\\r\\n\",\"score\":1},{\"url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/295\",\"repository_url\":\"https://api.github.com/repos/mac-cain13/R.swift\",\"labels_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/295/labels{/name}\",\"comments_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/295/comments\",\"events_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/295/events\",\"html_url\":\"https://github.com/mac-cain13/R.swift/issues/295\",\"id\":195240048,\"node_id\":\"MDU6SXNzdWUxOTUyNDAwNDg=\",\"number\":295,\"title\":\"Support for Cocoapods resource_bundles\",\"user\":{\"login\":\"wangguangfeng\",\"id\":6429998,\"node_id\":\"MDQ6VXNlcjY0Mjk5OTg=\",\"avatar_url\":\"https://avatars1.githubusercontent.com/u/6429998?v=4\",\"gravatar_id\":\"\",\"url\":\"https://api.github.com/users/wangguangfeng\",\"html_url\":\"https://github.com/wangguangfeng\",\"followers_url\":\"https://api.github.com/users/wangguangfeng/followers\",\"following_url\":\"https://api.github.com/users/wangguangfeng/following{/other_user}\",\"gists_url\":\"https://api.github.com/users/wangguangfeng/gists{/gist_id}\",\"starred_url\":\"https://api.github.com/users/wangguangfeng/starred{/owner}{/repo}\",\"subscriptions_url\":\"https://api.github.com/users/wangguangfeng/subscriptions\",\"organizations_url\":\"https://api.github.com/users/wangguangfeng/orgs\",\"repos_url\":\"https://api.github.com/users/wangguangfeng/repos\",\"events_url\":\"https://api.github.com/users/wangguangfeng/events{/privacy}\",\"received_events_url\":\"https://api.github.com/users/wangguangfeng/received_events\",\"type\":\"User\",\"site_admin\":false},\"labels\":[{\"id\":244348950,\"node_id\":\"MDU6TGFiZWwyNDQzNDg5NTA=\",\"url\":\"https://api.github.com/repos/mac-cain13/R.swift/labels/type:%20enhancement\",\"name\":\"type: enhancement\",\"color\":\"02AFE1\",\"default\":false}],\"state\":\"open\",\"locked\":false,\"assignee\":null,\"assignees\":[],\"milestone\":null,\"comments\":7,\"created_at\":\"2016-12-13T12:25:40Z\",\"updated_at\":\"2019-02-18T15:49:57Z\",\"closed_at\":null,\"author_association\":\"NONE\",\"body\":\"I use R.swift in a dynamic framework which organizes all the images for the main project and other frameworks. After the dynamic framework building successfully, but the image I access in main project is nil.\\r\\nThis is the code: `let image = R.image.driver_task_calender()`\\r\\nAfter check, I found the` let hostingBundle = Bundle(identifier: \\\"com.**.**\\\") ?? Bundle.main` is wrong.\\r\\n\\r\\nI think this is the correct hosting bundle \\r\\n\\r\\n```\\r\\nvar hostingBundle: Bundle {\\r\\n        let podBundle = Bundle(for: TheClassName.self)\\r\\n        if let bundleURL = podBundle.url(forResource: \\\"TheBundleName\\\", withExtension: \\\"bundle\\\") {\\r\\n            if let bundle = Bundle(url: bundleURL) {\\r\\n                return bundle\\r\\n            }\\r\\n        }\\r\\n        return podBundle\\r\\n    }\\r\\n```\\r\\n\\r\\nExpect to get help.\\r\\n\",\"score\":1},{\"url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/109\",\"repository_url\":\"https://api.github.com/repos/mac-cain13/R.swift\",\"labels_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/109/labels{/name}\",\"comments_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/109/comments\",\"events_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/109/events\",\"html_url\":\"https://github.com/mac-cain13/R.swift/issues/109\",\"id\":114592038,\"node_id\":\"MDU6SXNzdWUxMTQ1OTIwMzg=\",\"number\":109,\"title\":\"UIImage convenience none-optional initialisation method\",\"user\":{\"login\":\"andreyslyusar\",\"id\":1401690,\"node_id\":\"MDQ6VXNlcjE0MDE2OTA=\",\"avatar_url\":\"https://avatars1.githubusercontent.com/u/1401690?v=4\",\"gravatar_id\":\"\",\"url\":\"https://api.github.com/users/andreyslyusar\",\"html_url\":\"https://github.com/andreyslyusar\",\"followers_url\":\"https://api.github.com/users/andreyslyusar/followers\",\"following_url\":\"https://api.github.com/users/andreyslyusar/following{/other_user}\",\"gists_url\":\"https://api.github.com/users/andreyslyusar/gists{/gist_id}\",\"starred_url\":\"https://api.github.com/users/andreyslyusar/starred{/owner}{/repo}\",\"subscriptions_url\":\"https://api.github.com/users/andreyslyusar/subscriptions\",\"organizations_url\":\"https://api.github.com/users/andreyslyusar/orgs\",\"repos_url\":\"https://api.github.com/users/andreyslyusar/repos\",\"events_url\":\"https://api.github.com/users/andreyslyusar/events{/privacy}\",\"received_events_url\":\"https://api.github.com/users/andreyslyusar/received_events\",\"type\":\"User\",\"site_admin\":false},\"labels\":[{\"id\":244348821,\"node_id\":\"MDU6TGFiZWwyNDQzNDg4MjE=\",\"url\":\"https://api.github.com/repos/mac-cain13/R.swift/labels/state:%20awaiting%20input\",\"name\":\"state: awaiting input\",\"color\":\"EDCE24\",\"default\":false},{\"id\":244348928,\"node_id\":\"MDU6TGFiZWwyNDQzNDg5Mjg=\",\"url\":\"https://api.github.com/repos/mac-cain13/R.swift/labels/type:%20discussion\",\"name\":\"type: discussion\",\"color\":\"6902E1\",\"default\":false}],\"state\":\"closed\",\"locked\":false,\"assignee\":null,\"assignees\":[],\"milestone\":null,\"comments\":6,\"created_at\":\"2015-11-02T13:19:43Z\",\"updated_at\":\"2019-02-17T23:04:47Z\",\"closed_at\":\"2015-12-07T21:14:38Z\",\"author_association\":\"NONE\",\"body\":\"Maybe R.swift should support UIImage convenience none-optional init method, similar to SwiftGen:\\n\\n```\\nextension UIImage {\\n    enum Asset : String {\\n        case Apple = \\\"Apple\\\"\\n        case Banana = \\\"Banana\\\"\\n\\n        var image: UIImage {\\n            return UIImage(asset: self)\\n        }\\n    }\\n\\n    convenience init!(asset: Asset) {\\n        self.init(named: asset.rawValue)\\n    }\\n}\\n```\\n\\nWhat do you think? Are they any possibility image will be not initialised, in case we sure resource with current name exists? \\n\",\"score\":1},{\"url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/489\",\"repository_url\":\"https://api.github.com/repos/mac-cain13/R.swift\",\"labels_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/489/labels{/name}\",\"comments_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/489/comments\",\"events_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/489/events\",\"html_url\":\"https://github.com/mac-cain13/R.swift/issues/489\",\"id\":410866185,\"node_id\":\"MDU6SXNzdWU0MTA4NjYxODU=\",\"number\":489,\"title\":\"Slow build times for R.generated.swift\",\"user\":{\"login\":\"jalone87\",\"id\":2760440,\"node_id\":\"MDQ6VXNlcjI3NjA0NDA=\",\"avatar_url\":\"https://avatars0.githubusercontent.com/u/2760440?v=4\",\"gravatar_id\":\"\",\"url\":\"https://api.github.com/users/jalone87\",\"html_url\":\"https://github.com/jalone87\",\"followers_url\":\"https://api.github.com/users/jalone87/followers\",\"following_url\":\"https://api.github.com/users/jalone87/following{/other_user}\",\"gists_url\":\"https://api.github.com/users/jalone87/gists{/gist_id}\",\"starred_url\":\"https://api.github.com/users/jalone87/starred{/owner}{/repo}\",\"subscriptions_url\":\"https://api.github.com/users/jalone87/subscriptions\",\"organizations_url\":\"https://api.github.com/users/jalone87/orgs\",\"repos_url\":\"https://api.github.com/users/jalone87/repos\",\"events_url\":\"https://api.github.com/users/jalone87/events{/privacy}\",\"received_events_url\":\"https://api.github.com/users/jalone87/received_events\",\"type\":\"User\",\"site_admin\":false},\"labels\":[],\"state\":\"open\",\"locked\":false,\"assignee\":null,\"assignees\":[],\"milestone\":null,\"comments\":2,\"created_at\":\"2019-02-15T17:16:41Z\",\"updated_at\":\"2019-02-17T13:56:37Z\",\"closed_at\":null,\"author_association\":\"NONE\",\"body\":\"Xcode 10.x\\r\\nSwift 4.2\\r\\n- R.swift (5.0.2):\\r\\n    - R.swift.Library (~> 5.0.0)\\r\\n\\r\\nHello,\\r\\nI'm working on average/big sized project, the compile times are becoming really high, so much that autocomplete and syntax highlighting have become unusable, i started investigating bottle necks and it appears with [BuildTimeAnalyzer](https://github.com/RobertGummesson/BuildTimeAnalyzer-for-Xcode) that `R.generated.swift` takes the most out of the 2 minutes compilation times with 50 seconds just to compile it's 15.000 lines. Generation of the file takes a neglectable time (around 1 second).\\r\\n\\r\\nI tried using `.rswiftignore` file but it has little effect since most of the variable are due to localization strings and xibs, these are the main reason for using it and cannot be ignored.\\r\\n\\r\\n**Are the alternative practices or known build time optimizations appliable?** The project is about to take some considerable size leaps and if we don't solve this we will be sadly forced to ditch R.swift pod.\\r\\n\",\"score\":1},{\"url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/488\",\"repository_url\":\"https://api.github.com/repos/mac-cain13/R.swift\",\"labels_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/488/labels{/name}\",\"comments_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/488/comments\",\"events_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/488/events\",\"html_url\":\"https://github.com/mac-cain13/R.swift/issues/488\",\"id\":409705125,\"node_id\":\"MDU6SXNzdWU0MDk3MDUxMjU=\",\"number\":488,\"title\":\"knm\",\"user\":{\"login\":\"sergiosantano\",\"id\":9150510,\"node_id\":\"MDQ6VXNlcjkxNTA1MTA=\",\"avatar_url\":\"https://avatars1.githubusercontent.com/u/9150510?v=4\",\"gravatar_id\":\"\",\"url\":\"https://api.github.com/users/sergiosantano\",\"html_url\":\"https://github.com/sergiosantano\",\"followers_url\":\"https://api.github.com/users/sergiosantano/followers\",\"following_url\":\"https://api.github.com/users/sergiosantano/following{/other_user}\",\"gists_url\":\"https://api.github.com/users/sergiosantano/gists{/gist_id}\",\"starred_url\":\"https://api.github.com/users/sergiosantano/starred{/owner}{/repo}\",\"subscrip