ns_url\":\"https://api.github.com/users/Kjens93/orgs\",\"repos_url\":\"https://api.github.com/users/Kjens93/repos\",\"events_url\":\"https://api.github.com/users/Kjens93/events{/privacy}\",\"received_events_url\":\"https://api.github.com/users/Kjens93/received_events\",\"type\":\"User\",\"site_admin\":false},\"labels\":[{\"id\":244348757,\"node_id\":\"MDU6TGFiZWwyNDQzNDg3NTc=\",\"url\":\"https://api.github.com/repos/mac-cain13/R.swift/labels/difficulty:%20moderate\",\"name\":\"difficulty: moderate\",\"color\":\"40741F\",\"default\":false},{\"id\":302330091,\"node_id\":\"MDU6TGFiZWwzMDIzMzAwOTE=\",\"url\":\"https://api.github.com/repos/mac-cain13/R.swift/labels/type:%20chore\",\"name\":\"type: chore\",\"color\":\"207de5\",\"default\":false}],\"state\":\"open\",\"locked\":false,\"assignee\":null,\"assignees\":[],\"milestone\":null,\"comments\":5,\"created_at\":\"2018-09-27T06:08:32Z\",\"updated_at\":\"2019-02-05T07:59:55Z\",\"closed_at\":null,\"author_association\":\"NONE\",\"body\":\"At our company, we don't use CocoaPods for dependency resolution/management, but we really like R.swift and it would be really cool to have a simple command to install R.swift as a command-line tool on our development and CI machines, namely:\\r\\n```bash\\r\\nbrew install rswift\\r\\n```\\r\\nIt shouldn't be too difficult to create Homebrew Formulae for future releases and start shipping them off to homebrew/homebrew-core as another step in the R.swift deploy lifecycle.\\r\\n\\r\\nInformation about building Homebrew formulae can be found [here](https://github.com/Homebrew/homebrew-core/blob/master/CONTRIBUTING.md).\",\"score\":1},{\"url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/465\",\"repository_url\":\"https://api.github.com/repos/mac-cain13/R.swift\",\"labels_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/465/labels{/name}\",\"comments_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/465/comments\",\"events_url\":\"https://api.github.com