"https://api.github.com/users/KingOlami/gists{/gist_id}\",\"starred_url\":\"https://api.github.com/users/KingOlami/starred{/owner}{/repo}\",\"subscriptions_url\":\"https://api.github.com/users/KingOlami/subscriptions\",\"organizations_url\":\"https://api.github.com/users/KingOlami/orgs\",\"repos_url\":\"https://api.github.com/users/KingOlami/repos\",\"events_url\":\"https://api.github.com/users/KingOlami/events{/privacy}\",\"received_events_url\":\"https://api.github.com/users/KingOlami/received_events\",\"type\":\"User\",\"site_admin\":false},\"labels\":[{\"id\":244348821,\"node_id\":\"MDU6TGFiZWwyNDQzNDg4MjE=\",\"url\":\"https://api.github.com/repos/mac-cain13/R.swift/labels/state:%20awaiting%20input\",\"name\":\"state: awaiting input\",\"color\":\"EDCE24\",\"default\":false}],\"state\":\"closed\",\"locked\":false,\"assignee\":null,\"assignees\":[],\"milestone\":null,\"comments\":3,\"created_at\":\"2019-01-04T09:56:10Z\",\"updated_at\":\"2019-02-05T07:52:39Z\",\"closed_at\":\"2019-02-05T07:52:39Z\",\"author_association\":\"NONE\",\"body\":\"Hi, awesome library. I noticed that every time I build or run the application, this is always duplicated and leading to an error so, I have to delete it manually every time \\r\\n\\r\\n```\\r\\nextension R {\\r\\n\\t// Don't have to type R.string.localizable everytime  \\r\\n\\ttypealias text = R.string.localizable  \\r\\n}\\r\\n```\\r\\n\\r\\nany fix for this issue?\\r\\n\\r\\nI am running the latest version 5\",\"score\":1},{\"url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/483\",\"repository_url\":\"https://api.github.com/repos/mac-cain13/R.swift\",\"labels_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/483/labels{/name}\",\"comments_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/483/comments\",\"events_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/483/events\",\"html_url\":\"https://github.com/mac-cain13/R.swift/issues/483\",\"id\":402558926,\"node_id\":\"MDU6SXNzdWU0MDI1NTg5MjY=\",\"number\":483,\"title\":\"Project with R.swift as Pod\",\"user\":{\"login\":\"EvsenevDev\",\"id\":20614330,\"node_id\":\"MDQ6VXNlcjIwNjE0MzMw\",\"avatar_url\":\"https://avatars2.githubusercontent.com/u/20614330?v=4\",\"gravatar_id\":\"\",\"url\":\"https://api.github.com/users/EvsenevDev\",\"html_url\":\"https://github.com/EvsenevDev\",\"followers_url\":\"https://api.github.com/users/EvsenevDev/followers\",\"following_url\":\"https://api.github.com/users/EvsenevDev/following{/other_user}\",\"gists_url\":\"https://api.github.com/users/EvsenevDev/gists{/gist_id}\",\"starred_url\":\"https://api.github.com/users/EvsenevDev/starred{/owner}{/repo}\",\"subscriptions_url\":\"https://api.github.com/users/EvsenevDev/subscriptions\",\"organizations_url\":\"https://api.github.com/users/EvsenevDev/orgs\",\"repos_url\":\"https://api.github.com/users/EvsenevDev/repos\",\"events_url\":\"https://api.github.com/users/EvsenevDev/events{/privacy}\",\"received_events_url\":\"https://api.github.com/users/EvsenevDev/received_events\",\"type\":\"User\",\"site_admin\":false},\"labels\":[],\"state\":\"closed\",\"locked\":false,\"assignee\":null,\"assignees\":[],\"milestone\":null,\"comments\":1,\"created_at\":\"2019-01-24T06:18:31Z\",\"updated_at\":\"2019-02-05T07:51:23Z\",\"closed_at\":\"2019-02-05T07:51:23Z\",\"author_association\":\"NONE\",\"body\":\"Hi, we have project which using R.swift for **xibs, strings, assets**.\\r\\nWe are going to use this project as Pod.\\r\\nIn Podspec we added dependency **R.swift**\\r\\n\\r\\n```\\r\\ns.source_files  = \\\"APPNAME/**/*.{swift}\\\"\\r\\ns.exclude_files = \\\"APPNAME/AppDelegate.swift\\\"\\r\\ns.resource_bundles = { \\\"APPNAME\\\" => [\\\"APPNAME/**/*.{png,jpeg,jpg,xcassets,pdf,stringsdict,strings,storyboard,xib}\\\"] }\\r\\n```\\r\\n\\r\\n**Issue:**\\r\\nOur generated R file in .gitignore and R.swift should generate file from Xcode project which not included into Podspec. Included just resources and swift files.\\r\\n\\r\\n**Question:** \\r\\nHow we can avoid commit `R.swift.generated` and generate it after `pod install` our project (with R.swift) as dependency?\",\"score\":1},{\"url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/486\",\"repository_url\":\"https://api.github.com/repos/mac-cain13/R.swift\",\"labels_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/486/labels{/name}\",\"comments_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/486/comments\",\"events_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/486/events\",\"html_url\":\"https://github.com/mac-cain13/R.swift/issues/486\",\"id\":406257683,\"node_id\":\"MDU6SXNzdWU0MDYyNTc2ODM=\",\"number\":486,\"title\":\"Ignore different files in different schemas\\\\configurations\",\"user\":{\"login\":\"mkubista\",\"id\":21294149,\"node_id\":\"MDQ6VXNlcjIxMjk0MTQ5\",\"avatar_url\":\"https://avatars0.githubusercontent.com/u/21294149?v=4\",\"gravatar_id\":\"\",\"url\":\"https://api.github.com/users/mkubista\",\"html_url\":\"https://github.com/mkubista\",\"followers_url\":\"https://api.github.com/users/mkubista/followers\",\"following_url\":\"https://api.github.com/users/mkubista/following{/other_user}\",\"gists_url\":\"https://api.github.com/users/mkubista/gists{/gist_id}\",\"starred_url\":\"https://api.github.com/users/mkubista/starred{/owner}{/repo}\",\"subscriptions_url\":\"https://api.github.com/users/mkubista/subscriptions\",\"organizations_url\":\"https://api.github.com/users/mkubista/orgs\",\"repos_url\":\"https://api.github.com/users/mkubista/repos\",\"events_url\":\"https://api.github.com/users/mkubista/events{/privacy}\",\"received_events_url\":\"https://api.github.com/users/mkubista/received_events\",\"type\":\"User\",\"site_admin\":false},\"labels\":[],\"state\":\"open\",\"locked\":false,\"assignee\":null,\"assignees\":[],\"milestone\":null,\"comments\":2,\"created_at\":\"2019-02-04T10:10:54Z\",\"updated_at\":\"2019-02-05T07:47:18Z\",\"closed_at\":null,\"author_association\":\"NONE\",\"body\":\"In our project, which have multiple targets and multiple build configurations, we run into the issue with EXCLUDED_SOURCE_FILE_NAMES settings. We are excluding some files for production builds (and some parts of source codes). \\r\\n\\r\\nWhen we dont add ignore file, there is a problem with production build. If we add the global ignore file, the error is in our develop instance build.\\r\\n\\r\\nI think, that R should have its own mechanism for selective ignore, or it should check EXCLUDED_SOURCE_FILE_NAMES for automatic ignore.\\r\\n\\r\\nOr mI missing something?\",\"score\":1},{\"url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/416\",\"repository_url\":\"https://api.github.com/repos/mac-cain13/R.swift\",\"labels_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/416/labels{/name}\",\"comments_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/416/comments\",\"events_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/416/events\",\"html_url\":\"https://github.com/mac-cain13/R.swift/issues/416\",\"id\":331005450,\"node_id\":\"MDU6SXNzdWUzMzEwMDU0NTA=\",\"number\":416,\"title\":\"Xcode 10 / Swift 4.2 ABI change\",\"user\":{\"login\":\"sloik\",\"id\":1531955,\"node_id\":\"MDQ6VXNlcjE1MzE5NTU=\",\"avatar_url\":\"https://avatars0.githubusercontent.com/u/1531955?v=4\",\"gravatar_id\":\"\",\"url\":\"https://api.github.com/users/sloik\",\"html_url\":\"https://github.com/sloik\",\"followers_url\":\"https://api.github.com/users/sloik/followers\",\"following_url\":\"https://api.github.com/users/sloik/following{/other_user}\",\"gists_url\":\"https://api.github.com/users/sloik/gists{/gist_id}\",\"starred_url\":\"https://api.github.com/users/sloik/starred{/owner}{/repo}\",\"subscriptions_url\":\"https://api.github.com/users/sloik/subscriptions\",\"organizations_url\":\"https://api.github.com/users/sloik/orgs\",\"repos_url\":\"https://api.github.com/users/sloik/repos\",\"events_url\":\"https://api.github.com/users/sloik/events{/privacy}\",\"received_events_url\":\"https://api.github.com/users/sloik/received_events\",\"type\":\"User\",\"site_admin\":false},\"labels\":[],\"state\":\"closed\",\"locked\":false,\"assignee\":null,\"assignees\":[],\"milestone\":null,\"comments\":7,\"created_at\":\"2018-06-10T21:48:23Z\",\"updated_at\":\"2019-02-04T10:40:10Z\",\"closed_at\":\"2018-06-11T13:34:46Z\",\"author_association\":\"NONE\",\"body\":\"```swift\\r\\n//\\r\\n//  NibResource+UIKit.swift\\r\\n//  R.swift.Library\\r\\n//\\r\\n//  Created by Mathijs Kadijk on 06-01-16.\\r\\n//  From: https://github.com/mac-cain13/R.swift.Library\\r\\n//  License: MIT License\\r\\n//\\r\\n\\r\\nimport Foundation\\r\\nimport UIKit\\r\\n\\r\\npublic extension NibResourceType {\\r\\n  /**\\r\\n   Instantiate the nib to get the top-level objects from this nib\\r\\n\\r\\n   - parameter ownerOrNil: The owner, if the owner parameter is nil, connections to File's Owner are not permitted.\\r\\n   - parameter options: Options are identical to the options specified with -[NSBundle loadNibNamed:owner:options:]\\r\\n\\r\\n   - returns: An array containing the top-level objects from the NIB\\r\\n   */\\r\\n  public func instantiate(withOwner ownerOrNil: Any?, options optionsOrNil: [AnyHashable : Any]? = [:]) -> [Any] {\\r\\n    return UINib(resource: self).instantiate(withOwner: ownerOrNil, options: optionsOrNil)\\r\\n  }\\r\\n}\\r\\n```\\r\\n\\r\\nError:\\r\\n```\\r\\nreturn UINib(resource: self).instantiate(withOwner: ownerOrNil, options: optionsOrNil)\\r\\nCannot convert value of type '[AnyHashable : Any]?' to expected argument type '[UINib.OptionsKey : Any]?\\r\\n```\",\"score\":1},{\"url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/294\",\"repository_url\":\"https://api.github.com/repos/mac-cain13/R.swift\",\"labels_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/294/labels{/name}\",\"comments_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/294/comments\",\"events_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/294/events\",\"html_url\":\"https://github.com/mac-cain13/R.swift/issues/294\",\"id\":194457481,\"node_id\":\"MDU6SXNzdWUxOTQ0NTc0ODE=\",\"number\":294,\"title\":\"Localized strings with named parameters from .strings file\",\"user\":{\"login\":\"SpacyRicochet\",\"id\":904596,\"node_id\":\"MDQ6VXNlcjkwNDU5Ng==\",\"avatar_url\":\"https://avatars0.githubusercontent.com/u/904596?v=4\",\"gravatar_id\":\"\",\"url\":\"https://api.github.com/users/SpacyRicochet\",\"html_url\":\"https://github.com/SpacyRicochet\",\"followers_url\":\"https://api.github.com/users/SpacyRicochet/followers\",\"following_url\":\"https://api.github.com/users/SpacyRicochet/following{/other_user}\",\"gists_url\":\"https://api.github.com/users/SpacyRicochet/gists{/gist_id}\",\"starred_url\":\"https://api.github.com/users/SpacyRicochet/starred{/owner}{/repo}\",\"subscriptions_url\":\"https://api.github.com/users/SpacyRicochet/subscriptions\",\"organizations_url\":\"https://api.github.com/users/SpacyRicochet/orgs\",\"repos_url\":\"https://api.github.com/users/SpacyRicochet/repos\",\"events_url\":\"https://api.github.com/users/SpacyRicochet/events{/privacy}\",\"received_events_url\":\"https://api.github.com/users/SpacyRicochet/received_events\",\"type\":\"User\",\"site_admin\":false},\"labels\":[{\"id\":244348950,\"node_id\":\"MDU6TGFiZWwyNDQzNDg5NTA=\",\"url\":\"https://api.github.com/repos/mac-cain13/R.swift/labels/type:%20enhancement\",\"name\":\"type: enhancement\",\"color\":\"02AFE1\",\"default\":false}],\"state\":\"open\",\"locked\":false,\"assignee\":null,\"assignees\":[],\"milestone\":null,\"comments\":5,\"created_at\":\"2016-12-08T22:07:00Z\",\"updated_at\":\"2019-02-01T12:23:34Z\",\"closed_at\":null,\"author_association\":\"NONE\",\"body\":\"Instead of only generating named parameters for localised string functions if they're taken from a stringsdict file, you could also add a rule/option that generates named functions from keys as well.\\r\\n\\r\\nFor example;\\r\\n\\r\\n```\\\"test_string_amount%@\\\" = \\\"A test string with amount '%@'\\\";```\\r\\n\\r\\nCould be used like this;\\r\\n\\r\\n```R.string.localizable.testString(amount: \\\"3\\\")```\",\"score\":1},{\"url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/485\",\"repository_url\":\"https://api.github.com/repos/mac-cain13/R.swift\",\"labels_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/485/labels{/name}\",\"comments_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/485/comments\",\"events_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/485/events\",\"html_url\":\"https://github.com/mac-cain13/R.swift/pull/485\",\"id\":404281659,\"node_id\":\"MDExOlB1bGxSZXF1ZXN0MjQ4NDk4ODI2\",\"number\":485,\"title\":\"Add mint support\",\"user\":{\"login\":\"lilpit\",\"id\":654251,\"node_id\":\"MDQ6VXNlcjY1NDI1MQ==\",\"avatar_url\":\"https://avatars3.githubusercontent.com/u/654251?v=4\",\"gravatar_id\":\"\",\"url\":\"https://api.github.com/users/lilpit\",\"html_url\":\"https://github.com/lilpit\",\"followers_url\":\"https://api.github.com/users/lilpit/followers\",\"following_url\":\"https://api.github.com/users/lilpit/following{/other_user}\",\"gists_url\":\"https://api.github.com/users/lilpit/gists{/gist_id}\",\"starred_url\":\"https://api.github.com/users/lilpit/starred{/owner}{/repo}\",\"subscriptions_url\":\"https://api.github.com/users/lilpit/subscriptions\",\"organizations_url\":\"https://api.github.com/users/lilpit/orgs\",\"repos_url\":\"https://api.github.com/users/lilpit/repos\",\"events_url\":\"https://api.github.com/users/lilpit/events{/privacy}\",\"received_events_url\":\"https://api.github.com/users/lilpit/received_events\",\"type\":\"User\",\"site_admin\":false},\"labels\":[],\"state\":\"open\",\"locked\":false,\"assignee\":null,\"assignees\":[],\"milestone\":null,\"comments\":1,\"created_at\":\"2019-01-29T13:05:08Z\",\"updated_at\":\"2019-01-30T07:21:07Z\",\"closed_at\":null,\"author_association\":\"NONE\",\"pull_request\":{\"url\":\"https://api.github.com/repos/mac-cain13/R.swift/pulls/485\",\"html_url\":\"https://github.com/mac-cain13/R.swift/pull/485\",\"diff_url\":\"https://github.com/mac-cain13/R.swift/pull/485.diff\",\"patch_url\":\"https://github.com/mac-cain13/R.swift/pull/485.patch\"},\"body\":\"If you don't use Cocoapods in your project, there is no proper way to manage the R.swift dependancy.\\r\\n\\r\\nA dependency manager based on SwifPM called [Mint](https://github.com/yonaskolb/Mint) is ganning traction in the community and is already supported by some other swift based tools like Carthage or SwiftGen.\\r\\n\\r\\nThis PR just adds a product to Package.swift, the only required thing needed by Mint to work. \\r\\nTo make R.swift installable via mint, a new Release of R.Swift will be needed\",\"score\":1},{\"url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/474\",\"repository_url\":\"https://api.github.com/repos/mac-cain13/R.swift\",\"labels_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/474/labels{/name}\",\"comments_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/474/comments\",\"events_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/474/events\",\"html_url\":\"https://github.com/mac-cain13/R.swift/issues/474\",\"id\":393462179,\"node_id\":\"MDU6SXNzdWUzOTM0NjIxNzk=\",\"number\":474,\"title\":\"optionsOrNil produce error and warnings\",\"user\":{\"login\":\"ntnmrndn\",\"id\":1104823,\"node_id\":\"MDQ6VXNlcjExMDQ4MjM=\",\"avatar_url\":\"https://avatars3.githubusercontent.com/u/1104823?v=4\",\"gravatar_id\":\"\",\"url\":\"https://api.github.com/users/ntnmrndn\",\"html_url\":\"https://github.com/ntnmrndn\",\"followers_url\":\"https://api.github.com/users/ntnmrndn/followers\",\"following_url\":\"https://api.github.com/users/ntnmrndn/following{/other_user}\",\"gists_url\":\"https://api.github.com/users/ntnmrndn/gists{/gist_id}\",\"starred_url\":\"https://api.github.com/users/ntnmrndn/starred{/owner}{/repo}\",\"subscriptions_url\":\"https://api.github.com/users/ntnmrndn/subscriptions\",\"organizations_url\":\"https://api.github.com/users/ntnmrndn/orgs\",\"repos_url\":\"https://api.github.com/users/ntnmrndn/repos\",\"events_url\":\"https://api.github.com/users/ntnmrndn/events{/privacy}\",\"received_events_url\":\"https://api.github.com/users/ntnmrndn/received_events\",\"type\":\"User\",\"site_admin\":false},\"labels\":[],\"state\":\"closed\",\"locked\":false,\"assignee\":null,\"assignees\":[],\"milestone\":null,\"comments\":9,\"created_at\":\"2018-12-21T13:38:58Z\",\"updated_at\":\"2019-01-28T21:46:22Z\",\"closed_at\":\"2018-12-21T14:14:00Z\",\"author_association\":\"NONE\",\"body\":\"Hi,\\r\\n\\r\\nI just tried to upgrade to the 5.0 release, but got an error:\\r\\n\\r\\n```\\r\\n  struct nib: Rswift.Validatable {\\r\\n    static func validate() throws {\\r\\n      try _PlaybackCell.validate()\\r\\n    }\\r\\n    \\r\\n    struct _DebugPanelViewController: Rswift.NibResourceType {\\r\\n      let bundle = R.hostingBundle\\r\\n      let name = \\\"DebugPanelViewController\\\"\\r\\n      \\r\\n      func firstView(owner ownerOrNil: AnyObject?, options optionsOrNil: [UINib.OptionsKey : Any]? = nil) -> UIKit.UIView? {\\r\\n        return instantiate(withOwner: ownerOrNil, options: optionsOrNil)[0] as? UIKit.UIView //<== Cannot convert value of type '[UINib.OptionsKey : Any]?' to expected argument type '[NSString : Any]?'\\r\\n      }\\r\\n      \\r\\n      fileprivate init() {}\\r\\n    }\\r\\n      \\r\\n```\\r\\n\\r\\nAny idea what's going on ?\\r\\n\",\"score\":1},{\"url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/480\",\"repository_url\":\"https://api.github.com/repos/mac-cain13/R.swift\",\"labels_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/480/labels{/name}\",\"comments_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/480/comments\",\"events_url\":\"https://api.github.com