":\"2019-01-05T15:13:42Z\",\"updated_at\":\"2019-01-21T13:04:18Z\",\"closed_at\":\"2019-01-21T13:04:18Z\",\"author_association\":\"NONE\",\"body\":\"Now if you want to separate localization files to layers, you should create different *.strings files. But I've found it complicated to localize all of this strings files. If, for example, in Main.strings I specified key pair such as `welcome.title = \\\"Hello world\\\";` and then could access it like `R.string.main.welcome.title` instead of `R.string.main.welcomeTitle`, it would be nice.\",\"score\":1},{\"url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/397\",\"repository_url\":\"https://api.github.com/repos/mac-cain13/R.swift\",\"labels_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/397/labels{/name}\",\"comments_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/397/comments\",\"events_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/397/events\",\"html_url\":\"https://github.com/mac-cain13/R.swift/issues/397\",\"id\":307179068,\"node_id\":\"MDU6SXNzdWUzMDcxNzkwNjg=\",\"number\":397,\"title\":\".rswiftignore doesn't work\",\"user\":{\"login\":\"marekpridal\",\"id\":14936321,\"node_id\":\"MDQ6VXNlcjE0OTM2MzIx\",\"avatar_url\":\"https://avatars3.githubusercontent.com/u/14936321?v=4\",\"gravatar_id\":\"\",\"url\":\"https://api.github.com/users/marekpridal\",\"html_url\":\"https://github.com/marekpridal\",\"followers_url\":\"https://api.github.com/users/marekpridal/followers\",\"following_url\":\"https://api.github.com/users/marekpridal/following{/other_user}\",\"gists_url\":\"https://api.github.com/users/marekpridal/gists{/gist_id}\",\"starred_url\":\"https://api.github.com/users/marekpridal/starred{/owner}{/repo}\",\"subscriptions_url\":\"https://api.github.com/users/marekpridal/subscriptions\",\"organizations_url\":\"https://api.github.com/users/marekpridal/orgs\",\"repos_url\":\"https://api.github.com/users/marekpridal/repos\",\"events_url\":\"https://api.github.com/users/marekpridal/events{/privacy}\",\"received_events_url\":\"https://api.github.com/users/marekpridal/received_events\",\"type\":\"User\",\"site_admin\":false},\"labels\":[],\"state\":\"closed\",\"locked\":false,\"assignee\":null,\"assignees\":[],\"milestone\":null,\"comments\":5,\"created_at\":\"2018-03-21T09:57:44Z\",\"updated_at\":\"2019-01-16T11:10:10Z\",\"closed_at\":\"2018-04-18T10:45:35Z\",\"author_association\":\"NONE\",\"body\":\"Hi, I want to implement R.swift in my project but I need to use it just for Localizable.strings file. Unfortunately I am not able to implement it with .rswiftignore file. I have .rswiftignore file in the same folder as generated R.swift file but it seems, generator doesn't use it. \",\"score\":1},{\"url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/306\",\"repository_url\":\"https://api.github.com/repos/mac-cain13/R.swift\",\"labels_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/306/labels{/name}\",\"comments_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/306/comments\",\"events_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/306/events\",\"html_url\":\"https://github.com/mac-cain13/R.swift/issues/306\",\"id\":213887942,\"node_id\":\"MDU6SXNzdWUyMTM4ODc5NDI=\",\"number\":306,\"title\":\"[RFC] Support .ttc font format\",\"user\":{\"login\":\"DanielAsher\",\"id\":7915553,\"node_id\":\"MDQ6VXNlcjc5MTU1NTM=\",\"avatar_url\":\"https://avatars1.githubusercontent.com/u/7915553?v=4\",\"gravatar_id\":\"\",\"url\":\"https://api.github.com/users/DanielAsher\",\"html_url\":\"https://github.com/DanielAsher\",\"followers_url\":\"https://api.github.com/users/DanielAsher/followers\",\"following_url\":\"https://api.github.com/users/DanielAsher/following{/other_user}\",\"gists_url\":\"https://api.github.com/users/DanielAsher/gists{/gist_id}\",\"starred_url\":\"https://api.github.com/users/DanielAsher/starred{/owner}{/repo}\",\"subscriptions_url\":\"https://api.github.com/users/DanielAsher/subscriptions\",\"organizations_url\":\"https://api.github.com/users/DanielAsher/orgs\",\"repos_url\":\"https://api.github.com/users/DanielAsher/repos\",\"events_url\":\"https://api.github.com/users/DanielAsher/events{/privacy}\",\"received_events_url\":\"https://api.github.com/users/DanielAsher/received_events\",\"type\":\"User\",\"site_admin\":false},\"labels\":[{\"id\":244348950,\"node_id\":\"MDU6TGFiZWwyNDQzNDg5NTA=\",\"url\":\"https://api.github.com/repos/mac-cain13/R.swift/labels/type:%20enhancement\",\"name\":\"type: enhancement\",\"color\":\"02AFE1\",\"default\":false}],\"state\":\"open\",\"locked\":false,\"assignee\":null,\"assignees\":[],\"milestone\":null,\"comments\":6,\"created_at\":\"2017-03-13T20:30:02Z\",\"updated_at\":\"2019-01-10T16:08:22Z\",\"closed_at\":null,\"author_association\":\"NONE\",\"body\":\"As far as my (limited) understanding goes, MacOS/iOS support the `ttc` collection font format. `Rswift` currently ignores these in the `font` struct. Should these be supported?\\r\\n\\r\\nthanks,\\r\\n\\r\\nDaniel\",\"score\":1},{\"url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/219\",\"repository_url\":\"https://api.github.com/repos/mac-cain13/R.swift\",\"labels_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/219/labels{/name}\",\"comments_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/219/comments\",\"events_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/219/events\",\"html_url\":\"https://github.com/mac-cain13/R.swift/issues/219\",\"id\":155905699,\"node_id\":\"MDU6SXNzdWUxNTU5MDU2OTk=\",\"number\":219,\"title\":\"Localised Strings in addition to currentLocale\",\"user\":{\"login\":\"uny\",\"id\":1780156,\"node_id\":\"MDQ6VXNlcjE3ODAxNTY=\",\"avatar_url\":\"https://avatars1.githubusercontent.com/u/1780156?v=4\",\"gravatar_id\":\"\",\"url\":\"https://api.github.com/users/uny\",\"html_url\":\"https://github.com/uny\",\"followers_url\":\"https://api.github.com/users/uny/followers\",\"following_url\":\"https://api.github.com/users/uny/following{/other_user}\",\"gists_url\":\"https://api.github.com/users/uny/gists{/gist_id}\",\"starred_url\":\"https://api.github.com/users/uny/starred{/owner}{/repo}\",\"subscriptions_url\":\"https://api.github.com/users/uny/subscriptions\",\"organizations_url\":\"https://api.github.com/users/uny/orgs\",\"repos_url\":\"https://api.github.com/users/uny/repos\",\"events_url\":\"https://api.github.com/users/uny/events{/privacy}\",\"received_events_url\":\"https://api.github.com/users/uny/received_events\",\"type\":\"User\",\"site_admin\":false},\"labels\":[{\"id\":244348950,\"node_id\":\"MDU6TGFiZWwyNDQzNDg5NTA=\",\"url\":\"https://api.github.com/repos/mac-cain13/R.swift/labels/type:%20enhancement\",\"name\":\"type: enhancement\",\"color\":\"02AFE1\",\"default\":false}],\"state\":\"open\",\"locked\":false,\"assignee\":null,\"assignees\":[],\"milestone\":null,\"comments\":14,\"created_at\":\"2016-05-20T07:45:59Z\",\"updated_at\":\"2019-01-10T06:25:17Z\",\"closed_at\":null,\"author_association\":\"CONTRIBUTOR\",\"body\":\"I would like to use localized strings in addition to `NSLocale.currentLocale()`.\\n\\n**Pattern 1:**\\n\\n``` swift\\nstruct string {\\n  struct localizable {\\n    let locale: NSLocale\\n    init(locale: NSLocale = NSLocale.currentLocale()) {\\n      self.locale = locale\\n    }\\n    /// Locales: en, ja\\n    static func helloWorld() -> String {\\n        return String(format: NSLocalizedString(\\\"HelloWorld\\\", comment: \\\"\\\"), locale: self.locale)\\n    }\\n  }\\n}\\n```\\n\\n**Pattern 2:**\\n\\n``` swift\\nstruct string {\\n  struct en {\\n    /// Locales: en, ja\\n    static func helloWorld() -> String {\\n        return String(format: NSLocalizedString(\\\"HelloWorld\\\", comment: \\\"\\\"), locale: NSLocale(localeIdentifier: \\\"en\\\"))\\n    }\\n  }\\n}\\n```\\n\",\"score\":1},{\"url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/475\",\"repository_url\":\"https://api.github.com/repos/mac-cain13/R.swift\",\"labels_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/475/labels{/name}\",\"comments_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/475/comments\",\"events_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/475/events\",\"html_url\":\"https://github.com/mac-cain13/R.swift/issues/475\",\"id\":394042435,\"node_id\":\"MDU6SXNzdWUzOTQwNDI0MzU=\",\"number\":475,\"title\":\"Output files validation\",\"user\":{\"login\":\"Salfetamen\",\"id\":8879604,\"node_id\":\"MDQ6VXNlcjg4Nzk2MDQ=\",\"avatar_url\":\"https://avatars2.githubusercontent.com/u/8879604?v=4\",\"gravatar_id\":\"\",\"url\":\"https://api.github.com/users/Salfetamen\",\"html_url\":\"https://github.com/Salfetamen\",\"followers_url\":\"https://api.github.com/users/Salfetamen/followers\",\"following_url\":\"https://api.github.com/users/Salfetamen/following{/other_user}\",\"gists_url\":\"https://api.github.com/users/Salfetamen/gists{/gist_id}\",\"starred_url\":\"https://api.github.com/users/Salfetamen/starred{/owner}{/repo}\",\"subscriptions_url\":\"https://api.github.com/users/Salfetamen/subscriptions\",\"organizations_url\":\"https://api.github.com/users/Salfetamen/orgs\",\"repos_url\":\"https://api.github.com/users/Salfetamen/repos\",\"events_url\":\"https://api.github.com/users/Salfetamen/events{/privacy}\",\"received_events_url\":\"https://api.github.com/users/Salfetamen/received_events\",\"type\":\"User\",\"site_admin\":false},\"labels\":[],\"state\":\"closed\",\"locked\":false,\"assignee\":null,\"assignees\":[],\"milestone\":null,\"comments\":7,\"created_at\":\"2018-12-25T18:27:42Z\",\"updated_at\":\"2019-01-09T18:00:55Z\",\"closed_at\":\"2018-12-30T16:34:55Z\",\"author_association\":\"NONE\",\"body\":\"I was trying to set up R.swift 5.0.0 in my development pod that is placed in `project_root/Development Pods/pod_name` and got an error `[R.swift] Build phase Output Files do not contain '$SRCROOT/../Development Pods/pod_name/pod_name/Classes/R.generated.swift'.`\\r\\n\\r\\nThe problem is in `EnvironmentValidation.swift:45` where path strings are compared. In my case, `outputURL.path =  project_root/Pods/../Development Pods/pod_name/pod_name/Classes/R.generated.swift` and `scriptOutputFile = project_root/Development Pods/pod_name/pod_name/Classes/R.generated.swift` which both represents single path but strings are different\",\"score\":1},{\"url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/476\",\"repository_url\":\"https://api.github.com/repos/mac-cain13/R.swift\",\"labels_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/476/labels{/name}\",\"comments_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/476/comments\",\"events_url\":\"https://api.github.com/repos/mac-cain13/R.swift/issues/476/events\",\"html_url\":\"https://github.com/mac-cain13/R.swift/pull/476\",\"id\":394042491,\"node_id\":\"MDExOlB1bGxSZXF1ZXN0MjQwODg4OTg3\",\"number\":476,\"title\":\"Development pods output file validation fix\",\"user\":{\"login\":\"Salfetamen\",\"id\":8879604,\"node_id\":\"MDQ6VXNlcjg4Nzk2MDQ=\",\"avatar_url\":\"https://avatars2.githubusercontent.com/u/8879604?v=4\",\"gravatar_id\":\"\",\"url\":\"https://api.github.com/users/Salfetamen\",\"html_url\":\"https://github.com/Salfetamen\",\"followers_url\":\"https://api.github.com/users/Salfetamen/followers\",\"following_url\":\"https://api.github.com/users/Salfetamen/following{/other_user}\",\"gists_url\":\"https://api.github.com/users/Salfetamen/gists{/gist_id}\",\"starred_url\":\"https://api.github.com/users/Salfetamen/starred{/owner}{/repo}\",\"subscriptions_url\":\"https://api.github.com/users/Salfetamen/subscriptions\",\"organizations_url\":\"https://api.github.com/users/Salfetamen/orgs\",\"repos_url\":\"https://api.github.com/users/Salfetamen/repos\",\"events_url\":\"https://api.github.com/users/Salfetamen/events{/privacy}\",\"received_events_url\":\"https://api.github.com/users/Salfetamen/received_events\",\"type\":